import React from 'react';
import './Privacy.css';

const Privacy = () => (
  <div className="main">
    <h3>PRIVACY POLICY</h3>For information gathered from visitors, the log files are stored on our web server saving details such as visitors&apos; IP address, browser type, referring page and time of visit. Cookies may be used to remember visitor preferences when interacting with the website. Where registration is required, the visitor&apos;s email and a username will be stored on the server.
    The information is used to enhance the vistor&apos;s experience when using the website to display personalised content and possibly advertising. E-mail addresses and other information collected by Pandafreelance.com will not be sold, rented or leased to 3rd parties. E-mails may be sent to inform you of news of our services or offers by us or our affiliates.
  </div>
);

export default Privacy;
